import React from 'react'
import { Modal, Form, Input, Slider, Divider, Radio, InputNumber, Button, Space } from 'antd'
import { MinusCircleOutlined, PlusOutlined } from '@ant-design/icons'

// It's called nota, but actually is the complete expedient 

export default function NuevaNota({ isModalOpen, setIsModalOpen }) {

    const handleOk = () => {
        setIsModalOpen(false);
    };
    const handleCancel = () => {
        setIsModalOpen(false);
    };

    const onFinish = (values) => {
        console.log('New Exp:', values);
    };
    const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
    };

    const marks = { 0: '0', 10: '10' };

    return <Modal title="Nuevo Expediente Fisioterapia" open={isModalOpen} onOk={handleOk} onCancel={handleCancel}
        footer={[
            <Button>Cancelar</Button>,
            <Button type='primary' htmlType='submit' form='add_expediente_fisio'>Guardar</Button>
        ]}
    >
        <Form
            name="add_expediente_fisio"
            labelCol={{ span: 8 }}
            wrapperCol={{ span: 16 }}
            initialValues={{}}
            onFinish={onFinish}
            onFinishFailed={onFinishFailed}
            autoComplete="off"
        >

            <Form.Item label="motivo" name="motivo" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.Item label="tiempo" name="tiempo" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.Item label="momento_dia" name="momento_dia" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.Item label="movimientos" name="movimientos" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.Item label="localizacion" name="localizacion" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.Item label="localizacion_es" name="localizacion_es" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.Item label="tipo" name="tipo" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>


            <Form.Item label="tipo_es" name="tipo_es" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.Item label="ena" name="ena" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Slider defaultValue={0} min={0} max={10} marks={marks} />
            </Form.Item>

            <Divider>Rangos de Movimiento/Goniometria</Divider>

            <Form.Item label="articulacion" name="Articulacion" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.Item label="movimiento" name="movimiento" rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.Item name='completa' label="completa" rules={[{ required: false, message: 'Selecciona una opcion' }]} >
                <Radio.Group onChange={(val) => console.log('Selected ', val)} >
                    <Radio value={true}>Si</Radio>
                    <Radio value={false}>No</Radio>
                </Radio.Group>
            </Form.Item>

            <Form.Item name='ayuda' label="Ayuda" rules={[{ required: false, message: 'Selecciona una opcion' }]} >
                <Radio.Group onChange={(val) => console.log('Selected ', val)} >
                    <Radio value={true}>Necesita ayuda</Radio>
                    <Radio value={false}>Solo</Radio>
                </Radio.Group>
            </Form.Item>

            <Form.Item name='dolor' label="Dolor" rules={[{ required: false, message: 'Selecciona una opcion' }]} >
                <Radio.Group onChange={(val) => console.log('Selected ', val)} >
                    <Radio value={true}>Si</Radio>
                    <Radio value={false}>No</Radio>
                </Radio.Group>
            </Form.Item>

            <Form.Item label="Grados" name="grados" rules={[{ required: true, message: 'Please input your username!' }]}>
                <InputNumber />
            </Form.Item>

            <Divider>Examen manual muscular</Divider>

            <Form.Item label="Grupo muscular" name={['examenes', 'grupo']} rules={[{ required: true, message: 'Please input your username!' }]}>
                <Input />
            </Form.Item>

            <Form.List name="users">
                {(fields, { add, remove }) => (
                    <>
                        {fields.map(({ key, name, ...restField }) => (
                            <Space
                                key={key}
                                style={{
                                    display: 'flex',
                                    marginBottom: 8,
                                }}
                                align="baseline"
                            >
                                <Form.Item
                                    {...restField}
                                    label='first'
                                    name={[name, 'first']}
                                    rules={[
                                        {
                                            required: true,
                                            message: 'Missing first name',
                                        },
                                    ]}
                                >
                                    <Input placeholder="First Name" />
                                </Form.Item>
                                <Form.Item
                                    {...restField}
                                    label='last'
                                    name={[name, 'last']}
                                    rules={[
                                        {
                                            required: true,
                                            message: 'Missing last name',
                                        },
                                    ]}
                                >
                                    <Input placeholder="Last Name" />
                                </Form.Item>
                                <MinusCircleOutlined onClick={() => remove(name)} />
                            </Space>
                        ))}
                        <Form.Item>
                            <Button type="dashed" onClick={() => add()} block icon={<PlusOutlined />}>
                                Add field
                            </Button>
                        </Form.Item>
                    </>
                )}
            </Form.List>

        </Form>
    </Modal>
}
